import React from 'react';

const Card = () => {
  return (
    <div style={styles.card}>
      <p style={styles.text}>
        This is a card!
      </p>
    </div>
  );
};

const styles = {
  card: {
    width: 300,
    height: 200,
    backgroundColor: 'white',
    borderRadius: 10,
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    padding: 20,
    margin: 20,
  },
  text: {
    fontSize: 18,
  },
};

export default Card;
